import React from "react";
import "./Css/MapSection.css";

export default function MapSection() {
  return (
    <div className="mapSection">
      <iframe
        title="RS Associates Location"
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3806.215687290389!2d78.39954777453342!3d17.450418702420516!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bcb91b1c65c48b7%3A0x90de87d3c8a2a3d1!2sHyderabad%2C%20Telangana!5e0!3m2!1sen!2sin!4v1696513749475!5m2!1sen!2sin"
        width="100%"
        height="400"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
        referrerPolicy="no-referrer-when-downgrade"
      ></iframe>
    </div>
  );
}
